import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

const Contactenos = () => {
    return (
      <div style={{ minHeight: '100vh', display: 'flex', flexDirection: 'column' }}>
        <Header />
  
        <main style={{ flex: 1, padding: '2rem', color: '#fff' }}>
          <h1>Contáctenos</h1>
          <p>
            Puedes escribirnos a <a href="mailto:contacto@funnymind.com" style={{ color: '#FFD700' }}>contacto@funnymind.com</a> 
            o seguirnos en nuestras redes sociales para más información.
          </p>
        </main>
  
        <Footer />
      </div>
    );
  };
  
  export default Contactenos;
